icas dispondo assim de um serviço mais personalizado e adequado a cada caso individual. Nunca adie a sua ida ao médico, pois o diagnóstico precoce de qualquer patologia pode salvar a sua vida. Conte, no Trofa Saúde com uma equipa de médicos especialistas em Cirurgia Geral com vasta experiência, disponível em horário alargado e com capacidade e meios técnicos para dar resposta à sua situação, num ambiente NÃO COVID-19, com toda a segurança e conforto. \n\nSe dispõe de um vale-cirurgia SIGIC emitido pelo hospital público para realização de uma cirurgia no âmbito da Cirurgia Geral saiba que o pode utilizar nas unidades Trofa Saúde, mesmo que no seu vale não conste nenhuma unidade Trofa Saúde. Use o seu vale-cirurgia SIGIC no Trofa Saúde e faça a cirurgia que necessita sem custos acrescidos para si. \n\nMarcação de consultas e exames e mais informações através do 252090600.\n\nConte connosco em todos os momentos da sua vida.","styleRuns":[{"startIndex":0,"length":1259,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1259,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"videoDescriptionTranscriptSectionRenderer":{"sectionTitle":{"runs":[{"text":"Transcrição"}]},"subHeaderText":{"runs":[{"text":"Acompanhe usando a transcrição."}]},"primaryButton":{"buttonRenderer":{"style":"STYLE_SUGGESTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Mostrar transcrição"}]},"trackingParams":"CCIQtooIIhMInaS_orPOiQMVCggeAB3s2QzK","command":{"clickTrackingParams":"CCIQtooIIhMInaS_orPOiQMVCggeAB3s2QzK","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CCIQtooIIhMInaS_orPOiQMVCggeAB3s2QzK","showEngagementPanelEndpoint":{"panelIdentifier":"engagement-panel-searchable-transcript","sourcePanelIdentifier":"video-description-ep-identifier"}},{"clickTr
